import React from "react"

function Socials () {
  return (
    <div class="socials">
      <ul>
        <li><a href="https://www.facebook.com/zenbamboo">Facebook</a></li>
        <li><a href="https://www.instagram.com/zenbamboyz/">Instagram</a></li>
        <li><a href="https://zenbamboo.bandcamp.com/">Bandcamp</a></li>
      </ul>
    </div>
  )
}

export default Socials
